import React from "react";
import { AppBar, Tab, Tabs, Toolbar } from "@mui/material";
import '../css/Header.css'
import logo from '../img/equinor_logo.jpg'


function Header() {

    return (
        <React.Fragment>
            <div className="Header">
                <h1> Light Weight MPC </h1>
                <img src={logo} alt='Equinor logo'
                    style={ImageStyle}
                ></img>
            </div>
            <Toolbar/>
            <AppBar position="BOTTOM" sx={{height: 50, background: "#CCCCCC"}}>
                <Toolbar>
                    <Tabs>
                        <Tab label={Pages[0]}></Tab>
                    </Tabs>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    )
}

// BOTTOM: Place it on the Bottom of this element
// sx = style
export default Header
